// src/data/studentData.js
const studentData = [
    {
      id: 'S1001',
      name: 'John Doe',
      email: 'john@example.com',
      password: 'pass123', // Store securely in production
      paymentStatus: 'Paid',
      sessionEnd: '2024-09-30',
    },
    {
      id: 'S1002',
      name: 'Jane Smith',
      email: 'jane@example.com',
      password: 'pass456',
      paymentStatus: 'Unpaid',
      sessionEnd: '2024-09-20',
    },
  ];
  
  export default studentData;
